import React from "react";

const LocationTable = ({ locations, setIsFormOpen }) => {
  return (
    <div className="table-container">
      <div className="btn-container">
        <button className="btn" onClick={() => setIsFormOpen(true)}>Add Location</button>
      </div>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Notes</th>
            <th>LAT</th>
            <th>LNG</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {locations.map((row, index) => (
            <tr key={index}>
              <td>{row.name}</td>
              <td>{row.notes}</td>
              <td>{row.lat}</td>
              <td>{row.lng}</td>
              <td className="edit">Edit</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default LocationTable;
